import "./Navbar.css";
import profilepic from "./profile.jpg";

export default function Navbar () {
  return (
    <div className="navbar">
        <img src={profilepic}/>
        <p>Username</p>
        <p>role</p>
      <ul>
        <li><a href="#home">Home</a></li>
        <li><a href="#about">About</a></li>
        <li><a href="#services">Services</a></li>
        <li><a href="#contact">Contact</a></li>
      </ul>
    </div>
  );
};
